const initialState = {
    subjectSelection: {
        category: null,
        courseName: null
    },
    questionAnswerPairs: [],
    gameChooserURL: null,
    lockChooser: null,
    safeChooser: null,
    mirrorChooser: null,
    doorChooser: null,
    clueChooser: null,
    questionContainer: null  
};

export default function(state = initialState, action){
    const {type, payload}  = action;

    switch(type){
        default:
            return {...state}
    }
}
